import React, { useState } from "react";
import {
  Typography,
  TextField,
  Button,
  Stepper,
  Step,
  StepLabel,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import {
  Modal,

  Form,
  Col,
  Row,
  Container,
  FormGroup,
} from "react-bootstrap";
const useStyles = makeStyles((theme) => ({
  button: {
    marginRight: theme.spacing(1),
  },
}));

function getSteps() {
  return [
    "Personal Information",
    "Address & Region",
    "Education Information",
    "Previous Information",
    "Employement Details",
    "Bank Details"
  ];
}

function getStepContent(step) {
  switch (step) {
    case 0:
      return (
        <>
          
          <div className="w-75" id="responsivewidth">
                  <Col>
                    <Row >
                      <Col xxl="6" xl="6" lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridFirstName"
                          className="formmargin"
                        >
                          <Form.Label>First Name</Form.Label>
                          <Form.Control
                            type="text"
                            required
                            name="firstname"
                            placeholder="First Name"
                            // value={emp.firstname}
                            // onChange={handleinput}
                          />
                        </Form.Group>
                      </Col>
                      <Col xxl="6" xl="6" lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>Last Name</Form.Label>
                          <Form.Control
                            type="text"
                            required
                            name="lastname"
                            placeholder="Last Name"
                            // value={emp.lastname}
                            // onChange={handleinput}
                          />
                        </Form.Group>
                      </Col>
                    </Row>
                    <Row>
                      <Col xxl='6' xl='6' lg='6' md='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridgender"
                          className="formmargin"
                        >
                          <Form.Label>Gender</Form.Label>
                          <Form.Select
                            required
                            name="gender"
                            // value={emp.gender}
                            // onChange={handleinput}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Male</option>
                            <option>Female</option>
                            <option>Other</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                      <Col xl='6' lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridFirstName"
                          className="formmargin"
                        >
                          <Form.Label>National ID </Form.Label>
                          <Form.Control
                            type="number"
                            required
                            name="cnic"
                            placeholder="CNIC"
                            // value={emp.cnic}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          />
                        </Form.Group>
                      </Col>
                    </Row>
                    <Row>
                      <Col xxl='6' xl='6' lg='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>D-0-B</Form.Label>
                          {/* <DatePicker
                            required
                            selected={emp.dob}
                            onChange={(date)=>{setEmp({...emp,dob:moment(date).format('dd/mm/yyyy')})}}
                            // dateFormat='d MMMM, yyyy'
                            dateFormat='dd/mm/yyyy'
                            dropDownMode="select"
                          /> */}
                          <Form.Control
                            type="date"
                            required
                            placeholder="dd/mm/yyyy"
                            name="dob"
                            // value={emp.dob}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          />
                        </Form.Group>
                      </Col>

                      <Col  xl='6' lg="6" >
                        <Form.Group
                          as={Col}
                          controlId="formGridMartialStatus"
                          className="formmargin"
                        >
                          <Form.Label>Martial Status</Form.Label>
                          <Form.Select
                            required
                            name="martialStatus"
                            placeholder="martial status.."
                            // value={emp.martialStatus}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Single</option>
                            <option>Married</option>
                            <option>Divorced</option>
                            <option>widow</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                      <Col xl='6' lg='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>Religion</Form.Label>
                          <Form.Select
                            required
                            name="religion"
                            placeholder="Religion"
                            // value={emp.religion}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Islam</option>
                            <option>Christianity</option>
                            <option>Buddhism</option>
                            <option> Sikhism</option>
                            <option> Hinduism</option>
                            <option>Bahá’í</option>
                            <option>Confucianism</option>
                            <option>Jainism</option>
                            <option>Judaism</option>
                            <option>Zoroastrianism</option>
                            <option>Druze</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                    </Row>
                  </Col>
                  
                  </div>
                  
        </>
      );

    case 1:
      return (
        <>
         
            <div>
          <Row>
                    <h5
                      className="py-2 "
                      style={{ fontSize: "22px", padding: "0px 19px" }}
                    >
                      Primary
                    </h5>
           <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridphone"
                        className="formmargin "
                      >
                        <Form.Label>Phone</Form.Label>
                        <Form.Control
                          type="number"
                          required
                          name="primaryphone"
                          placeholder="phone"
                          // value={emp.primaryphone}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Email</Form.Label>
                        <Form.Control
                          type="email"
                          required
                          name="primaryemail"
                          placeholder="email"
                          // value={emp.primaryemail}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                  </Row>

                  <Row>
                    <h5
                      className="py-2 "
                      style={{ fontSize: "22px", padding: "0px 19px" }}
                    >
                      Secondary
                    </h5>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Phone</Form.Label>
                        <Form.Control
                          type="number"
                          required
                          name="secondaryphone"
                          placeholder="secondary phone"
                          // value={emp.secondaryphone}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Email</Form.Label>
                        <Form.Control
                          type="email"
                          required
                          name="secondaryemail"
                          placeholder="secondary Email"
                          // value={emp.secondaryemail}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    </Row>
                    </div>
        </>
      );
    case 2:
      return (
        <>
         <div>
            <Col lg={12}>
                  <Form.Group
                    as={Col}
                    controlId="formGridFirstName"
                    className="formmargin"
                  >
                    <Form.Label>Temporary Address</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="temporaryaddress"
                      placeholder="complete address"
                      // value={emp.temporaryaddress}
                      // onChange={handleinput}
                      //   disabled={disableFields}
                    />
                  </Form.Group>
                </Col>

                <Col lg={12}>
                  <Form.Group
                    as={Col}
                    controlId="formGridFirstName"
                    className="formmargin"
                  >
                    <Form.Label>Permanent Address</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="permanentaddress"
                      placeholder="complete address"
                      // value={emp.permanentaddress}
                      // onChange={handleinput}
                      //   disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
                {/* </Row> */}
                <div style={{marginLeft:'2%'}}>
                <Row>
                  <Col>
                    <Form.Label>City</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Select
                        required
                        // onChange={handleinput}
                        name="city"
                        // value={emp.city}
                      >
                        <option value="" selected hidden disabled>
                          Select City
                        </option>
                        {/* {cities.map((d, i) => {
                          return <option key={i}>{d}</option>;
                        })} */}
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Label>Province</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Select
                        required
                        name="province"
                        placeholder="province"
                        // value={emp.province}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      >
                        <option value="" selected hidden disabled>
                          Select Province
                        </option>
                        <option>Punjab</option>
                        <option>Sindh</option>
                        <option>KPK</option>
                        <option>Gilgit Baltistan</option>
                        <option>Islamabad(Capital Territory)</option>
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Label>Country</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      {/* <ReactFlags
                        countries={["PK"]}
                        selected={selected}
                        onSelect={(code) => {
                          setSelected(code);
                          code === "PK" && setcountry("Pakistan");
                          setEmp({...emp,country:"Pakistan"})
                        }}
                      /> */}
                    </Form.Group>
                  </Col>
                </Row>
                <Row>
                  <Col lg={4} xl={4}>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Postal Code</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="postalCode"
                        placeholder="postal code"
                        // value={emp.postalCode}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                </Row>
                </div>
                </div>
        </>
      );
    case 3:
      return (
        <>
          {/* <TextField
            id="cardNumber"
            label="Card Number"
            variant="outlined"
            placeholder="Enter Your Card Number"
            fullWidth
            margin="normal"
            name="cardNumber"
          />
          <TextField
            id="cardMonth"
            label="Card Month"
            variant="outlined"
            placeholder="Enter Your Card Month"
            fullWidth
            margin="normal"
            name="cardMonth"
          />
          <TextField
            id="cardYear"
            label="Card Year"
            variant="outlined"
            placeholder="Enter Your Card Year"
            fullWidth
            margin="normal"
            name="cardYear"
          /> */}
        </>
      );
      case 4:{
        return (
        <div>
          <Row>
        <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Username</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="username"
                        placeholder="username"
                        // value={emp.username}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Password</Form.Label>
                      <Form.Control
                        type="password"
                        required
                        name="password"
                        placeholder="password"
                        // value={emp.password}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridFirstName"
                      className="formmargin"
                    >
                      <Form.Label>Joining Date</Form.Label>
                      <Form.Control
                        type="date"
                        required
                        name="joiningdate"
                        placeholder="joining date"
                        // value={emp.joiningdate}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                </Row>
                <Row>
                  <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Salary</Form.Label>
                      <Form.Control
                        type="Number"
                        required
                        name="currentSalary"
                        placeholder="salary"
                        // value={emp.currentSalary}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Designation</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="designation"
                        placeholder="designation.."
                        // value={emp.terminationreason}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridFirstName"
                      className="formmargin"
                    >
                      <Form.Label>Payment Mode</Form.Label>
                      <Form.Select
                        required
                        name="paymentmode"
                        // value={emp.paymentmode}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      >
                        <option value="" selected hidden disabled>
                          Please Select
                        </option>
                        <option>Cheque</option>
                        <option>Cash</option>
                        <option>Bank Transfer</option>
                      </Form.Select>
                    </Form.Group>
                  </Col>
                </Row>
                <Row>
                  <Col lg={4}>
                    <Form.Group
                      as={Col}
                      controlId="formGriddepartments"
                      className="formmargin"
                    >
                      <Form.Label>Department</Form.Label>
                      <Form.Select                 name="departments">
                        {/* onChange={handleinput} */}
                        <option disabled selected defaultValue={""}>
                          Select department..
                        </option>
                        {/* {dep.map((d) => {
                          return (
                            <>
                              <option key={d._id} value={d._id}>
                                {d.departmentname}
                              </option>
                            </>
                          );
                        })} */}
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  <Col xl='4'>
                  <Form.Group
                      as={Col}
                      controlId="formGriddepartments"
                      className="formmargin"
                    >
                      <Form.Label>Employement Status</Form.Label>
                      <Form.Select
                      //  onChange={handleinput} 
                       name="employementstatus" 
                      //  value={emp.employementstatus}
                       >
                        <option defaultValue={""} disbaled selected hidden>Select Please</option>
                        <option>Intern</option>
                        <option>Probation</option>
                        <option>Permanent</option>
                        <option>Left</option>
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  </Row>
        </div>
       

       
        )
      };
      case 5:{
        return(
          <div>
            <Row>
            <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Bank Name</Form.Label>
                      <Form.Select
                        
                        required
                        name="bankname"
                        placeholder="bank name.."
                        // value={emp.bankname}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      >
                        <option>Please Select</option>
                        <option>MCB Limited</option>
                        <option>Bank Islami Limited</option>
                        <option>Allied Bank Limited</option>
                        <option>Bank Al-Habib Limited</option>
                        <option>Faysal Bank Limited</option>
                        <option>Mezaan Bank Limited</option>
                        <option>National Bank of Pakistan</option>
                        <option>MCB Islamic Limited</option>
                        <option>HBL</option>
                        <option>UBL</option>
                        <option>Askari Bank </option>
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Account Title</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="accounttitle"
                        placeholder="account title.."
                        // value={emp.accounttitle}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Account No</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="accountno"
                        placeholder="account no.."
                        // value={emp.accountno}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                </Row>
                <Row className="p-0">
                  <Col xxl={4}>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label> IBAN</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="IBAN"
                        placeholder="iban.."
                        // value={emp.IBAN}
                        // onChange={handleinput}
                        //  disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                 
                  <Col xxl={4}>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Branch code</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="branchcode"
                        placeholder="branch code.."
                        // value={emp.branchcode}
                        // onChange={handleinput}
                        //  disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                </Row>
          </div>
        )
      }
    default:
      return "unknown step";
  }
}

const EmployeeData = () => {
  const classes = useStyles();
  const [activeStep, setActiveStep] = useState(0);
  const [skippedSteps, setSkippedSteps] = useState([]);
  const steps = getSteps();

  const isStepOptional = (step) => {
    return step === 1 || step === 2;
  };

  const isStepSkipped = (step) => {
    return skippedSteps.includes(step);
  };

  const handleNext = () => {
    setActiveStep(activeStep + 1);
    setSkippedSteps(skippedSteps.filter((skipItem) => skipItem !== activeStep));
  };

  const handleBack = () => {
    setActiveStep(activeStep - 1);
  };

  const handleSkip = () => {
    if (!isStepSkipped(activeStep)) {
      setSkippedSteps([...skippedSteps, activeStep]);
    }
    setActiveStep(activeStep + 1);
  };

  return (
    <div style={{display:'flex',justifyContent:'center'}}>
    <div style={{width:'60%'}}>
      <Stepper alternativeLabel activeStep={activeStep}>
        {steps.map((step, index) => {
          const labelProps = {};
          const stepProps = {};
          // if (isStepOptional(index)) {
          //   labelProps.optional = (
          //     <Typography
          //       variant="caption"
          //       align="center"
          //       style={{ display: "block" }}
          //     >
          //       optional
          //     </Typography>
          //   );
          // }
          if (isStepSkipped(index)) {
            stepProps.completed = false;
          }
          return (
            <Step {...stepProps} key={index}>
              <StepLabel {...labelProps}>{step}</StepLabel>
            </Step>
          );
        })}
      </Stepper>

      {activeStep === steps.length ? (
        <Typography variant="h3" align="center">
          Thank You
        </Typography>
      ) : (
        <>
          <form>{getStepContent(activeStep)}</form>
          <Button
            className={classes.button}
            disabled={activeStep === 0}
            onClick={handleBack}
          >
            back
          </Button>
          {isStepOptional(activeStep) && (
            <Button
              className={classes.button}
              variant="contained"
              color="primary"
              onClick={handleSkip}
            >
              skip
            </Button>
          )}
          <Button
            className={classes.button}
            variant="contained"
            color="primary"
            onClick={handleNext}
           >
            {activeStep === steps.length - 1 ? "Finish" : "Next"}
          </Button>
        </>
      )}
    </div>
    </div>
  );
};

export default EmployeeData;
